"<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:16pt; font-weight:600; text-decoration: underline; color:#40424e;\">SCAN</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:13pt; color:#40424e;\">In SCAN algorithm the disk arm moves into a particular direction and services the requests coming in its path and after reaching the end of disk, it reverses its direction and again services the request arriving in its path. So, this algorithm works as an elevator and hence also known as </span><span style=\" font-size:13pt; font-weight:600; color:#40424e;\">elevator algorithm. </span><span style=\" font-size:13pt; color:#40424e;\">As a result, the requests at the midrange are serviced more and those arriving behind the disk arm will have to wait.</span></p>\n"
